let ribbonsWrapper = document.querySelectorAll('.ribbon4');
Array.from(ribbonsWrapper).forEach(ribbon => {
    ribbon.addEventListener('mouseenter', showRibbon)
    ribbon.addEventListener('mouseleave', closeRibbon)
})
function showRibbon() {
    let node = this.cloneNode(true);
    node.classList.add('ribbon_setup_width');
    document.body.appendChild(node);
    let myWidth = node.offsetWidth + 2;
    node.remove();
    this.style.width = `${myWidth}px`;
}
function closeRibbon() {
    this.style.width = ``;
}